import './header.css';
import { Link, useNavigate } from 'react-router-dom';
import { auth } from '../config/firebase';
import { useAuth } from '../config/firebase';


export const Header = () => {
    const currentUser = useAuth();
    const navigate = useNavigate();
  
    const Logout = () => {
     auth.signOut()
     .then(() => navigate('/'))
     .catch(error => console.log(error));
    }
   
    return (
    <header>
  
  <nav>

<ul id="meniu">
    <li>
    <div className="menu"><Link to = "/">Acasa</Link></div>
        
    </li>
    <li>
    <div className="menu"><Link to = "/restaurants">Filme</Link></div>
    </li>
    <li>
    {currentUser?
      <>
        <div className="menu"><Link to = "/profile" className = 'menu'>Cont</Link></div>
      </>
        :
      <>
        <div className="menu"><Link to = "/login" className = 'menu'>Login</Link></div>
      </>
      }
    
        
    </li>
    <li>
    {currentUser?
      <>
        <div className="menu" onClick={() => Logout()}>Log Out</div>
      </>
        :
      <>
        <div className="menu"><Link to = "/register" className = 'menu'>Register</Link></div>
      </>
      }
    </li>
</ul>
</nav>
 </header>

  );
    }
